import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import MainPage     from './MainPage';
import LoginPage    from './LoginPage';
import RegistPage   from './RegistPage.js';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          {/* Your header content */}
        </header>
        <Route path="/" exact component={MainPage} />
        <Route path="/login/login_player" component={LoginPage} />
        <Route path="/login/create_player" component={RegistPage} />

        <Route path="/room/login_room" component={LoginPage} />
        <Route path="/room/create_room" component={RegistPage} />
      </div>
    </Router>
  );
}

export default App;
